import React from "react";
import "../src/css/dep.css";
function Dep() {
  return (
    <div className="dmain">
      <div className="dbody">
        <div className="du">
          <button>20</button>
          <button>50</button>
          <button>100</button>
        </div>
        <div className="dl">
          <button>500</button>
          <button>1000</button>
          <button>2000</button>
        </div>
      </div>
    </div>
  );
}
export default Dep;
